INSERT INTO `posts` (`ID`, `UID`, `Text`, `Title`, `Pic`, `Genre`, `Location`, `FavCount`) VALUES
(1, 1, 'My mother’s friends say that I’m just like her. She died of breast cancer when I was two years old. I had to grow up fast because my father was always working and seldom around. I was doing my own laundry at the age of seven. I figured the puberty thing out on my own. During high school, I’d leave for entire weekends without my dad even asking where I’d been. Then one year at Thanksgiving, my aunt told me that my mother had left me a letter and a video. She got so angry when I told her I’d never gotten it. I confronted my Dad about it, and he said that he ‘remembered something like that.’ He drove me to a safety deposit box—but the box was empty. He couldn’t remember what happened. He had one job. One thing that would mean more to me than anything else, and he couldn’t do it. My mom’s friends always tell me: ‘She would be so proud of you,’ or ‘She was so in love with you. But that’s not the same. It’s not the same as something directly from her. Something she made especially for me. Just one thing that actually says: ‘This is how much I love you.', 'The Letter', , 'Inpirational', 'islamabad.', 31);
INSERT INTO `posts` (`ID`, `UID`, `Text`, `Title`, `Pic`, `Genre`, `Location`, `FavCount`) VALUES
(2, 1, 'I’m pretty sure I’m a sociopath. Or something close to it. My parents were pilots, so I spent most of my early childhood on a small island in Tunisia. The only other kids were the children of a local hotelkeeper. I was so isolated that I even invented my own words. By the time I got to high school, I was a monster. I only cared about being the best. I was a bully. I’d argue just for the sake of arguing. I would destroy any belief, just to be right. My behavior is different now. But I think I’m still a sociopath. I’m not sure I feel empathy. But I do always try to make the empathetic choice. It’s an intellectual thing for me. I’m intellectually convinced of the need for empathy. I choose to help other people. I choose to be a reliable friend. I have a wonderful wife who judges me by my actions, and not my reasons for them. Sometimes I feel like Pinocchio. Was he a real boy? Yes, because that’s what he always strived to be.', 'The Sociopath', , 'Intellectual', 'Tehran', 34);
INSERT INTO `posts` (`ID`, `UID`, `Text`, `Title`, `Pic`, `Genre`, `Location`, `FavCount`) VALUES
(3, 1, 'I almost married my high school sweetheart. She was a sharp girl. Very kind. Long brown hair, slim-- the whole package. We moved to California together after graduation. We spent all our time together. We were in love. We even talked about marriage several times. Then one morning she decided she didn’t want to do it anymore. She told me things had changed. It destroyed me. Ever since then, she’s been the one that I’ve always wondered about. I actually saw her a couple years ago. She came to New York for her father’s funeral, and we took a walk in Central Park together. I hadn’t seen her in forty-five years. She looked amazing. Exactly the same as I remembered. She had two kids. She’d gotten married to some guy from Yale. Toward the end of our walk, she told me that if she could do it all over again, she probably would have never married the guy. I said: ‘That breaks my heart, because all these years I imagined you were happy.’ Of course, there might have been a small part of me that was thinking: ‘Haha! You married the wrong guy.', 'The Real Winner', , 'Tragic', 'California', 321);
INSERT INTO `posts` (`ID`, `UID`, `Text`, `Title`, `Pic`, `Genre`, `Location`, `FavCount`) VALUES
(4, 3, 'A really bad divorce triggered the first and only manic episode of my life. It was my body’s attempt to avoid feeling any pain. I was sleeping three hours a night and doing handstands in the morning. I did a whole lot of writing. I’m a contractor-- so I taught myself all sorts of plastering techniques and developed an entire series of finishes. I worked as a carpenter for twelve hours every day. Eventually I pushed myself to the point where I injured my shoulder, and the doctor told me that I couldn’t work anymore. It forced me to slow down, confront the illness, and make friends with that part of myself. Now I’m on a mood stabilizer. I’m not operating in a triggered state anymore. And I’m back to work, but this time with a team of people to help me carry the load.', 'A Catastrophic Divorce', , 'Motivational', 'New York', 301);
INSERT INTO `posts` (`ID`, `UID`, `Text`, `Title`, `Pic`, `Genre`, `Location`, `FavCount`) VALUES
(5, 2, 'I’m about to meet up with my ex-girlfriend. We broke up two weeks ago and I’m hoping to get back together with her. I restricted her freedom too much. I scheduled all our classes together. I always wanted to know where she was. It all started a year ago when she cheated on me. She called me immediately afterwards and confessed. But ever since then, anytime she’s away from me, I always imagine the worst. She goes out with friends and some of them are male. So it’s hard for me to not get suspicious. And if I get suspicious, she gets nervous. Which makes me even more suspicious.', 'Obsessive Compulsion', , 'Mischiveous', 'London', 21);
INSERT INTO `posts` (`ID`, `UID`, `Text`, `Title`, `Pic`, `Genre`, `Location`, `FavCount`) VALUES
(6, 3, 'The only time my mother spoke to us was when she was drunk. And she’d tell us we were unwanted. She convinced me to drink with her when I was ten. She told me that it would make me feel better. I started smoking crack when I was twelve. I never learned to read or write. I lost my entire childhood. My friends and I would break into cars, steal whatever we could, and use the money to buy more. It made me feel good and I wanted to feel good all the time. And nobody ever tried to stop me.', 'Abusive Relationship', , 'Tragic', 'Louisiana', 101);
INSERT INTO `posts` (`ID`, `UID`, `Text`, `Title`, `Pic`, `Genre`, `Location`, `FavCount`) VALUES
(7, 3, 'My husband had a sudden heart attack a few months ago. It was just a few blocks from here. They called me in to identify his body and then just let me walk right out onto 7th Avenue. I felt so lost. My friends were wonderful and supportive but eventually everyone moves on with their lives. I don’t have children. And I’m not a workaholic. So I was left with this intense loneliness and void. I couldn’t eat. I couldn’t sleep. Then one day I started researching dogs that are good for grief and depression. And ‘poodle’ kept popping up. But when I went to the rescue fair, all the poodles were gone. There was this one old dog in the back that nobody was looking at. She was skin and bones. She was trembling and scared and mucus was running out of her eyes. She seemed so fragile. She reminded me of myself. I named her Grace because I think my husband sent her to me. She’s my first dog. She’s been pure joy. We spend all our time together. She’s gained her weight back. She comes with me to therapy. We’re getting better together.', 'The Dog', , 'Tragedy', 'New York', 154);
INSERT INTO `posts` (`ID`, `UID`, `Text`, `Title`, `Pic`, `Genre`, `Location`, `FavCount`) VALUES
(8, 3, 'We were together for nine years. I was completely dependent on him. He was a strong and powerful man and he expected obedience. If he called me at 4 AM, and told me to meet him in Moscow, I was expected to go to the train station. He had a very strong energy. It was hard to argue with him. In the beginning of the relationship, I obeyed because of the pressure. But then the pressure just became a habit. It got worse as time went on. Eventually he stopped listening to me completely. I became so lonely. When you’re with someone who doesn’t care about your views, and has no desire to understand you, it’s worse than being alone. I still loved him though. I knew that he’d had a hard life. I told myself that I had to make sacrifices to build a family. But one morning I woke up and decided that I couldn’t do it anymore. If I stayed in the relationship, I would lose myself completely. I remember it was raining that morning. There was mud in the streets. And something told me: ‘Today is the day.’ That was two years ago. I’ve spent these last two years learning to be alone. I’m realizing the things that I like to do. I feel better, I look better, and I’ve been sharing more of myself with others. I feel like I’m finally learning who I am.', 'Expected Obedience', , 'Motivational', 'Petersburg, Russia.', 164);
INSERT INTO `posts` (`ID`, `UID`, `Text`, `Title`, `Pic`, `Genre`, `Location`, `FavCount`) VALUES
(9, 3, 'I’m driving to pay off my student debts. I had to start college late because my father had a stroke shortly after I graduated high school. He couldn’t afford to stop working. So I worked in a fried chicken restaurant seven days a week while he recovered. When he first came home from the hospital, I carried him down the stairs. He had tears in his eyes. My father emigrated from Pakistan in the eighties. He worked hard so that I could have a better life. In that moment, I think he saw that I’d turned into the son that he’d always hoped for.', 'Compassion', , 'Motivational', 'Ireland', 284);
INSERT INTO `posts` (`ID`, `UID`, `Text`, `Title`, `Pic`, `Genre`, `Location`, `FavCount`) VALUES
(10, 3, 'We’ve been at war in this country for over fifty years. There have been hundreds of thousands of deaths and millions of victims. So a lot of people don’t like the work that I do. I manage a reintegration program for ex-combatants. I’m trying to take away the main tool of war-- human beings. We can’t punish everyone who fought against us. We can’t jail them all. That will only divide us further. So we must find a way to reconcile with the 60,000 ex-combatants that live among us. We must educate them. We must find them jobs. If we reject and stigmatize them, we will always be at war. Reconciliation is a very hard task. There are a lot of open wounds in this country. People don’t want to forgive. Ex-combatants are often viewed as monsters. My job is to show that their blood is like ours. If we can’t break the idea of ‘good’ and ‘evil,’ we will always be divided. Reconciliation is the only way to change the course of our history.', 'Binarization', , 'Hisorical', 'Colombia', 231);

